const bgColor = '#fafafa';
const classes = {
    container: {
        position: 'absolute',
        marginTop: '-20px',
        margin: 'auto',
        marginTop: '60px !important',
        padding: '0',
        width: '100%',
        backgroundColor: bgColor,
        zIndex: '-5',
        height: 'auto',
        width: '100vw'
    }
}

export {classes}
